import { useEffect, useState } from "react";
import { signIn, signOut, useSession } from 'next-auth/react';
import { Address, ProviderRpcClient } from "everscale-inpage-provider";
import { EverscaleStandaloneClient } from "everscale-standalone-client";
import { VenomConnect } from "venom-connect";
import testContractAbi from "./abi/test.abi.json";
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";
import {
  Box,
  Button,
  Container,
  Divider,
  Grid,
  Typography,
} from "@mui/material";

const App = () => {
  const { data: session, status: loading } = useSession();
  const [venomConnect, setVenomConnect] = useState<any>();
  const [venomProvider, setVenomProvider] = useState<any>();
  const [address, setAddress] = useState();
  const [balance, setBalance] = useState();
  const [theme, setTheme] = useState(initTheme);
  const [info, setInfo] = useState("");
  const [standaloneMethodsIsFetching, setStandaloneMethodsIsFetching] =
    useState(false);

  // Assume your existing functions and useEffect hooks here...

  // Add the functions to handle Github sign-in and sign-out
  const handleGithubSignIn = () => {
    signIn('github');
  }

  const handleSignOut = () => {
    signOut();
  }

  // Initialize Venom Connect
  const onInitButtonClick = async () => {
    const venomConnectInstance = new VenomConnect();
    setVenomConnect(venomConnectInstance);
  }

  // Connect Venom Connect to Wallet
  const onConnectButtonClick = async () => {
    if (!venomConnect) return;

    venomConnect.connect().then((provider: ProviderRpcClient) => {
      setVenomProvider(provider);
      const userAddress = new Address(provider.publicKey.toHex());
      setAddress(userAddress.toHex());
    });
  }

  // Disconnect Venom Connect from Wallet
  const onDisconnectButtonClick = async () => {
    if (!venomConnect) return;

    venomConnect.disconnect();
    setVenomProvider(null);
    setAddress(null);
  }

  return (
    <Box>
      <Grid container justifyContent="center" my={4}>
        <Grid item>
          <Typography variant="h1" component="h1" textAlign="center">
            Bounty Board
          </Typography>
        </Grid>
      </Grid>
      <Container>
        {!session ? (
          <>
            {!venomConnect && (
              <Grid
                container
                justifyContent={"center"}
                alignItems={"center"}
                gap={2}
              >
                <Grid item>
                  <>
                    <Button variant="contained" onClick={onInitButtonClick}>
                      Login/signup
                    </Button>
                  </>
                </Grid>
              </Grid>
            )}
            {venomConnect && (
              <Grid container direction={"column"} gap={6}>
                <Grid item>
                </Grid>
                <Grid item>
                  <Grid
                    container
                    direction={"column"}
                    alignItems={"center"}
                    gap={2}
                  >
                    <Typography variant="h5" component="span">
                     sign in with your wallet 
                    </Typography>

                    <Grid item>
                      {venomConnect && !address && (
                        <Button variant="contained" onClick={onConnectButtonClick}>
                          Connect wallet
                        </Button>
                      )}
                      {venomConnect && !!address && (
                        <Button
                          variant="contained"
                          onClick={onDisconnectButtonClick}
                        >
                          Disconnect
                        </Button>
                      )}
                    </Grid>

                    <Grid item>
                      <Typography variant="h5" component="span">
                        or
                      </Typography>
                    </Grid>
                    <Grid item>
                      <Button variant="contained" onClick={handleGithubSignIn}>
                       Connect with github
                      </Button>
                    </Grid>
                  </Grid>
                </Grid>
              </Grid>
            )}
          </>
        ) : (
          <>
            <h2>Welcome {session.user.name}</h2>
            <Button variant="contained" onClick={handleSignOut}>
              Sign Out
            </Button>
          </>
        )}
      </Container>
    </Box>
  );
};

export default App;
